export const Home = () => {
    return (
        <Row className="homeContent g-0">
            <Cont1/>
            <Col md={4}>
                <Cont2/>
                <Col md={12} className="cont3">
                    <Col className="AppDownload" md={6} >
                        <Row>
                            <Col ><div className="btoApp"><span>Hablemos</span></div></Col>
                        </Row>
                        <Row>
                            <Col ><div className="btoApp"><span>Más de Idiky...</span></div></Col>
                        </Row>
                    </Col>
                </Col>
            </Col>
        </Row>
    )
}


